def score(text):
    if isinstance(text,(bytes,bytearray)):
        text = text.decode('latin1')
    score = 0
    mono_freq = Counter(text)
    bi_freq = Counter( text[i:i+2] for i in range(len(text)-1) )
    for i in mono_freq:
        score+=mono_freq[i]*MONOGRAM_FREQ_FULL[i]*MONO_WEIGHT
    for i in bi_freq:
        score+=bi_freq[i]*BIGRAM_FREQ[i]*BI_WEIGHT
    return score

def single_byte_key(ct:bytes):
    scores = Counter()
    for i in range(256):
        scores[i]=score(xor(ct,bytes([i])))
    return scores.most_common(1)[0][0]

def hamming_distance(str1:bytes, str2:bytes)->int:
    count=0
    n1 = int.from_bytes(str1,'big')
    n2 = int.from_bytes(str2,'big')
    n = n1^n2
    while n:
        n&=(n-1)
        count+=1
    return count

def find_key_size(ct:bytes,MAX_KEYSIZE=None)->list:
    if not MAX_KEYSIZE:
        MAX_KEYSIZE=len(ct)
    norm_distances = []
    for KEYSIZE in tqdm(range(2,min(MAX_KEYSIZE,len(ct)//3))):
        blocks = [ct[i:i+KEYSIZE] for i in range(0,KEYSIZE*3,KEYSIZE)]
        dist_arr = [hamming_distance(i,j)/KEYSIZE for i,j in combinations(blocks,2)]
        dist = sum(dist_arr)/len(dist_arr)
        norm_distances.append((KEYSIZE,dist))
    return sorted(norm_distances,key = lambda x:x[1])

def find_key(ct, key_len):
    key = bytearray(key_len)
    for i in range(key_len):
        key[i] = single_byte_key(ct[i::key_len])
    return bytes(key)

def factint(num):
    return [i for i in range(2,num//2+1) if num%i==0]

def key_lengths_kasisiki(ct):
    n = len(ct)
    freq=Counter()
    i = 0
    while i < n-3:
        n_gram_len = 3
        for j in range(i+1,n):
            if ct[i:i+n_gram_len] == ct[j:j+n_gram_len]:
                while ct[i:i+n_gram_len] == ct[j:j+n_gram_len]:
                    n_gram_len+=1
                n_gram_len-=1
                for fac in factint(j-i):
                    freq[fac]+=1
                j = j + n_gram_len + 1
        i = i + n_gram_len -3 +1
    return sorted(freq,key = lambda i: i*freq[i]*freq[i],reverse=True)


